import { Redirect, Route } from "react-router"

export default function ProtectedRoute({ component: Component, path, ...props }) {
  const token = props.authToken;

  return(
    <Route exact path={path}>
      {token ? <Component {...props} /> : <Redirect to='/sign-in' />}
    </Route>
  )
}
